import React, { useEffect } from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
    faFacebook,
    faGithub,
    faInstagram,
    faLinkedin,
    faYoutube,
} from "@fortawesome/free-brands-svg-icons";
import { faEnvelope } from "@fortawesome/free-solid-svg-icons";
import "./Landing.css";
import AOS from "aos";

function Landing() {

    useEffect(() => {
        AOS.init();
    }, []);

    return (
        <div
            id="landingPage"
            className="container d-flex flex-row justify-content-center justify-content-md-start align-items-center w-100 h-100"
        >
            <div className="row w-100">
                <div className="col-12 col-md-6" data-aos="fade-up" data-aos-duration="1000">
                    <h1 className="mainTitle text-white text-md-start text-center my-2">
                        Achyut Neupane
                    </h1>
                </div>
                <div class="col-12" data-aos="fade-up">
                    <div className="d-flex flex-row justify-content-center justify-content-md-start text-white gap-2">
                        <a href="https://www.linkedin.com/in/achyutkneupane/" rel="noreferrer" target="_blank"
                                data-aos-delay="200" data-aos-duration="1000">
                            <FontAwesomeIcon
                                icon={faLinkedin}
                                size="2x"
                                style={{ color: "#ffffff" }}
                            />
                        </a>
                        <FontAwesomeIcon
                            icon={faGithub}
                            size="2x"
                            style={{ color: "#ffffff" }}
                            data-aos-delay="1200" data-aos-duration="1000"
                        />
                        <FontAwesomeIcon
                            icon={faFacebook}
                            size="2x"
                            style={{ color: "#ffffff" }}
                        />
                        <FontAwesomeIcon
                            icon={faInstagram}
                            size="2x"
                            style={{ color: "#ffffff" }}
                        />
                        <FontAwesomeIcon
                            icon={faYoutube}
                            size="2x"
                            style={{ color: "#ffffff" }}
                        />
                        <FontAwesomeIcon
                            icon={faEnvelope}
                            size="2x"
                            style={{ color: "#ffffff" }}
                        />
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Landing;
